import React from 'react';
import './BasketballBets.css';

const BasketballBets = () => {
  return (
    <div className="main-content basketball-bets-page">
      <h1>Basketball</h1>
      <div className="bets-list">
        <div className="bet-item">
          <div className="bet-date">Mon. Jun 24, 22:00</div>
          <div className="bet-teams">
            <div className="team-info">
              <div className="team">Toronto Raptors</div>
              <div className="team">Houston Rockets</div>
            </div>
            <div class="bet-item-grid">
  <div class="bet-date">Mon. Jun 24, 22:00</div>
  <div class="team-info">Toronto Raptors</div>
  <div class="team-info">Houston Rockets</div>
  <div class="bet-odds">Winner (incl. overtime)</div>
  <div class="odds">1.78</div>
  <div class="odds">2.20</div>
</div>

          </div>
        </div>
      </div>
    </div>
  );
};

export default BasketballBets;
